    transclude: 'element',                                                                                             // 23803
    priority: 600,                                                                                                     // 23804
    terminal: true,                                                                                                    // 23805
    restrict: 'A',                                                                                                     // 23806
    $$tlb: true,                                                                                                       // 23807
