        expect(input.getAttribute('value')).toEqual('say hello');                                                      // 25495
        input.sendKeys(protractor.Key.ESCAPE);                                                                         // 25496
        expect(input.getAttribute('value')).toEqual('say');                                                            // 25497
        other.click();                                                                                                 // 25498
        expect(model.getText()).toEqual('say');                                                                        // 25499
